const Stars = ({ number }) => {

    const [rating, setRating] = useState(number);
    return (
      <span className="star-rating">
        {[...Array(10)].map((star, index) => {
          index += 1;
          return (
            <span
              key={index}
              className={`star ${index <= (rating) ? "on" : "off"}`}
            >
              <span className="star">&#9733;</span>
            </span>
          );
        })}
      </span>)
};

export default Stars;
